package com.chen.model;

public class Dis {
	private String dis_id;
	private int dis_price;
	private String goods_id;
	private int dis_state;
	private int dis_num;
	public Dis() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getDis_id() {
		return dis_id;
	}
	public void setDis_id(String dis_id) {
		this.dis_id = dis_id;
	}
	public int getDis_price() {
		return dis_price;
	}
	public void setDis_price(int dis_price) {
		this.dis_price = dis_price;
	}
	public String getGoods_id() {
		return goods_id;
	}
	public void setGoods_id(String goods_id) {
		this.goods_id = goods_id;
	}
	public int getDis_state() {
		return dis_state;
	}
	public void setDis_state(int dis_state) {
		this.dis_state = dis_state;
	}
	public int getDis_num() {
		return dis_num;
	}
	public void setDis_num(int dis_num) {
		this.dis_num = dis_num;
	}
	
}
